clone.haxe_doc:
Clone the object.
Null values, strings, dates, numbers, enums and functions are immutable so will be returned as is. Anonymous objects will be created and each field cloned recursively. Arrays will be recreated and each object cloned recursively. Class instances will either be cloned, or the reference copied, depending on the value of `cloneInstances`.
@param v The object which will be cloned. @param cloneInstances If true, class instances will be cloned using `Type.createEmptyInstance` and `Reflect.setField`. If false, class instances will be re-used, not cloned. Default is false.

lift.haxe_doc:
Converts an instance of type `T` to an instance of type `U`.

Useful as an extension methods for converting a value to another type inside a chain of function calls.

E.g.

```
using thx.Functions;
import thx.Options;

var arr: Array<Int> = [1, 2, 3];
var opt : Option<Array<Int>> = myArray.lift(Options.ofValue);
Assert.same(Some(arr), opt); // true
```

